import React from 'react';
import classes from './Project.module.css';

const project = (props) => {
    return (
        <div className={classes.Project}>
            <h4>{props.name}</h4>
            <img src={props.pic} height={100} width={150}/>
            <p>{props.desc}</p>
        </div>
    )
}

export default project;
